a TARIC er en nærmere inndeling av produktgrupper i tillegg til KN-koden. TARIC er et internt system for EU som er knyttet til tollområdet. 2. Næringsmidler nevnt i artikkel 1 nr. 1) bokstav b) punkt ii)
Næringsmidler som består av to eller flere ingredienser, som inneholder en av de enkeltproduktene som er oppført i tabell 1 i dette vedlegget, på grunn av risikoen for forurensning med aflatoksiner i en mengde på over 20 % av enten et enkelt produkt eller som summen av de oppførte produktene
